% Tutte le canzoni di un artista
canzoni_di_un_artista(Artist,Title):- song(_, _, _, _, _, _, _, _, _, _, Artist, Title).
% Tracce con Elevato Grado di Danzabilità
titoli_alta_danzabilita(Titolo) :- song(Danceability, _, _, _, _, _, _, _, _, _, _, Titolo), Danceability >= 0.8.
% Titoli delle tracce con Livello di Energia Elevato
titoli_alta_energia(Titolo) :- song(_, Energy, _, _, _, _, _, _, _, _, _, Titolo), Energy >= 0.8.
% Titoli delle tracce Molto Strumentali
titoli_molto_strumentale(Titolo) :- song(_, _, _, _, _, _, Instrumentalness, _, _, _, _, Titolo), Instrumentalness >= 0.7.
% Titoli delle tracce in Chiave Maggiore
titoli_chiave_maggiore(Titolo) :- song(_, _, Key, _, _, _, _, _, _, _, _, Titolo), Key >= 7.
% Titoli delle tracce con Alta Probabilità di Registrazione Live
titoli_registrazione_live(Titolo) :- song(_, _, _, _, _, _, _, Liveness, _, _, _, Titolo), Liveness >= 0.7.
% Titoli delle tracce con Loudness Elevato
titoli_loudness_alto(Titolo) :- song(_, _, _, Loudness, _, _, _, _, _, _, _, Titolo), Loudness >= -5.0.
% Titoli delle tracce con Elevata Presenza di Parole Parlate
titoli_molto_parlante(Titolo) :- song(_, _, _, _, Speechiness, _, _, _, _, _, _, Titolo), Speechiness >= 0.7.
% Titoli delle tracce con Tempo Vivace (BPM > 120)
titoli_tempo_vivace(Titolo) :- song(_, _, _, _, _, _, _, _, _, Tempo, _, Titolo), Tempo >= 120.
% Titoli delle tracce con Valenza Positiva
titoli_valenza_positiva(Titolo) :- song(_, _, _, _, _, _, _, _, Valence, _, _, Titolo), Valence >= 0.7.
% titoli delle tracce con alta probabilità di essere acustiche
titoli_alta_acusticità(Titolo) :- song(_, _, _, _, _, Acousticness, _, _, _, _, _, Titolo), Acousticness >= 0.7.
% Titoli delle tracce con bassa danzabilità
titoli_bassa_danzabilita(Titolo) :- song(Danceability, _, _, _, _, _, _, _, _, _, _, Titolo), Danceability < 0.8.
% Titoli delle tracce con basso livello di energia
titoli_bassa_energia(Titolo) :- song(_, Energy, _, _, _, _, _, _, _, _, _, Titolo), Energy < 0.8.
% Titoli delle tracce Poco Strumentali
titoli_poco_strumentale(Titolo) :- song(_, _, _, _, _, _, Instrumentalness, _, _, _, _, Titolo), Instrumentalness < 0.7.
% Titoli delle tracce in Chiave Minore
titoli_chiave_minore(Titolo) :- song(_, _, Key, _, _, _, _, _, _, _, _, Titolo), Key < 7.
% Titoli delle tracce con Bassa Probabilità di Registrazione Live
titoli_registrazione_non_live(Titolo) :- song(_, _, _, _, _, _, _, Liveness, _, _, _, Titolo), Liveness < 0.7.
% Titoli delle tracce con Loudness Basso
titoli_loudness_basso(Titolo) :- song(_, _, _, Loudness, _, _, _, _, _, _, _, Titolo), Loudness < -5.0.
% Titoli delle tracce con Bassa Presenza di Parole Parlate
titoli_molto_poco_parlante(Titolo) :- song(_, _, _, _, Speechiness, _, _, _, _, _, _, Titolo), Speechiness < 0.7.
% Titoli delle tracce con Tempo Lento (BPM <= 120)
titoli_tempo_lento(Titolo) :- song(_, _, _, _, _, _, _, _, _, Tempo, _, Titolo), Tempo < 120.
% Titoli delle tracce con Valenza Negativa
titoli_valenza_negativa(Titolo) :- song(_, _, _, _, _, _, _, _ , Valence, _, _, Titolo), Valence < 0.7.
% titoli delle tracce con bassa probabilità di essere acustiche
titoli_bassa_acusticità(Titolo) :- song(_, _, _, _, _, Acousticness, _, _, _, _, _, Titolo), Acousticness < 0.7.
% Ritrova il valore di Danceability dato il titolo
danceability_di_titolo(Titolo, Danceability) :- song(Danceability, _, _, _, _, _, _, _, _, _, _, Titolo).
% Ritrova il valore di Energy dato il titolo
energy_di_titolo(Titolo, Energy) :- song(_, Energy, _, _, _, _, _, _, _, _, _, Titolo).
% Ritrova il valore di Key dato il titolo
key_di_titolo(Titolo, Key) :- song(_, _, Key, _, _, _, _, _, _, _, _, Titolo).
% Ritrova il valore di Loudness dato il titolo
loudness_di_titolo(Titolo, Loudness) :- song(_, _, _, Loudness, _, _, _, _, _, _, _, Titolo).
% Ritrova il valore di Speechiness dato il titolo
speechiness_di_titolo(Titolo, Speechiness) :- song(_, _, _, _, Speechiness, _, _, _, _, _, _, Titolo).
% Ritrova il valore di Acousticness dato il titolo
acousticness_di_titolo(Titolo, Acousticness) :- song(_, _, _, _, _, Acousticness, _, _, _, _, _, Titolo).
% Ritrova il valore di Instrumentalness dato il titolo
instrumentalness_di_titolo(Titolo, Instrumentalness) :- song(_, _, _, _, _, _, Instrumentalness, _, _, _, _, Titolo).
% Ritrova il valore di Liveness dato il titolo
liveness_di_titolo(Titolo, Liveness) :- song(_, _, _, _, _, _, _, Liveness, _, _, _, Titolo).
% Ritrova il valore di Valence dato il titolo
valence_di_titolo(Titolo, Valence) :- song(_, _, _, _, _, _, _, _, Valence, _, _, Titolo).
% Ritrova il valore di Tempo dato il titolo
tempo_di_titolo(Titolo, Tempo) :- song(_, _, _, _, _, _, _, _,_, Tempo, _, Titolo).
% Titoli delle canzoni danzabili di un artista
titoli_danzabili_di_artista(Artista, Titolo) :- canzoni_di_un_artista(Artista, Titolo), titoli_alta_danzabilita(Titolo).
% Titoli delle canzoni danzabili con molte parole
titoli_danzabili_con_molte_parole(Titolo) :- titoli_alta_danzabilita(Titolo), titoli_molto_parlante(Titolo).
% Titoli delle canzoni danzabili veloci
titoli_danzabili_veloci(Titolo) :- titoli_alta_danzabilita(Titolo), titoli_tempo_vivace(Titolo).
% Titoli delle canzoni danzabili lente
titoli_danzabili_lente(Titolo) :- titoli_alta_danzabilita(Titolo), titoli_tempo_lento(Titolo).
